@linaorde Te falto el pack suicida
Pack Suicida: Venezolana maleante, muerte segura😁😁😁

Pero, todo en son de broma, tenga amiga y conocidas, también tienen un lado positivo que rescató: la perseverancia.

@npekas @Marasot06416008 @plhalcartegaray @DebyNavarroR @wachunei ¿Que haces en medio de vándalos y saqueadores, delincuentes drogadictos que destruyen todo a su paso?
Dime con quién andas y te diré quien eres, es básico.
Si no quieres un perdigón o una bala a que vas a meterte a esos escenarios, hay que ser tarado o tener complejo suicida.

@FlordeM58187271 No basta con "ler"

Pero bueno hagamos de una cadena poco fortalecida y coyoteada 

Una fantasía suicida

@atvmasnoticias Para solicitar la incineración de un fallecido por SUICIDIO, se requiere de AUTORIZACIÓN JUDICIAL

Artículo 58 del DS 03-94-S.A Reglamento de la Ley de Cementerios y Servicios.

Qué Juzgado, con intervención del Ministerio Público, autorizó la incineración del suicida?

